import { Link } from "react-router-dom";

export default function OrderCompleted () {

  return(
    <section>
      <h1>
        Your Order is complete!
      </h1>
      <p>
      You will be receiving a confirmation email with order details.
      </p>
      <Link to='/'>
       <button className="general_btn">
      Go to the Home Page
      </button>
      </Link>
     
    </section>
  )
}
